import React from "react";
import { Foos } from '../styles/Footer';
import { contactData }                from "../data/contactData";

export default function Footer() {

	state = {
    	contactData: contactData
  	};

	return (
		<Foos>

			<div>
				<div className="copyright">copyright &copy; <span className="year">2020</span> PollWatch | all rights reserved</div>
  			</div>

		</Foos>
	);
}
